@congress_defund @bowlofcereal20 @horny_antifa @usedgov @GReschenthaler The fed gov is a currency issuer; not a currency user who needs to "find" the money like you do (or like a business does). 

They pass a bill, and the money exists. It really is that simple.

Works like that in Canada, China, Japan, Australia, UK, etc.
